// Import necessary components and libraries
import React, { useState } from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import Header from './Header';
import Home from './components/Home';
import People from './components/People';
import Biosensing from './components/Biosensing';
import EBeam from './components/EBeam';
import EnergyStorage from './components/EnergyStorage';
import Login from './components/login';
import Biosensor from './components/Biosensor';

function App() {
  const [loggedIn, setLoggedIn] = useState(false);

  const handleLogin = () => {
    setLoggedIn(true);
  };

  return (
    <Router>
      <Header />
      <div className="container">
        <Routes>
          <Route path="/" element={<Home />} />
          <Route path="/People" element={<People />} />
          <Route path="/Biosensing" element={<Biosensing />} />
          <Route path="/EBeam" element={<EBeam />} />
          <Route path="/EnergyStorage" element={<EnergyStorage />} />
          <Route
            path="/Biosensor"
            element={
              loggedIn ? (
                <Biosensor />
              ) : (
                <Navigate to="/Login" replace />
              )
            }
          />
          <Route
            path="/Login"
            element={<Login onLogin={() => setLoggedIn(true)} />}
          />
        </Routes>
      </div>
    </Router>
  );
}

export default App;
